import React from 'react';
import './Cadastrar.css';




export default function Cadastrar() {
    return(
        <div>
            <h2 id="cabecalho">
                <h1>Cadastrar</h1>
                <button id="voltar"></button>
            </h2>
                <form className="cadastro">
                    E-mail <br/>
                   <input type="email"/>
                </form>
        </div>
    )
};
